import React from 'react';
import Carousel, { Dots } from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';

const QuoteCarousel = () => {
  return (
    <div>
      <Carousel
        plugins={['arrows']}
      >
        <p>Hi0</p>    
        <p>Hi1</p>   
        <p>Hi2</p>   
      </Carousel>
    </div>
  );
};

export default QuoteCarousel;
